name: list-read-set-upload-parts
description: Lists all parts in a multipart read set upload for a sequence store and returns the metadata in a JSON formatted output.
flags:
    --cli-input-json=: Read arguments from the JSON string provided.
    --cli-input-yaml=: Read arguments from the YAML string provided.
    --filter=: Attributes used to filter for a specific subset of read set part uploads.
    --generate-cli-skeleton: Prints a JSON skeleton to standard output without sending an API request.
    --max-items=: The  total number of items to return in the command's output.
    --max-results=: The maximum number of read set upload parts returned in a page.
    --next-token=: Next token returned in the response of a previous ListReadSetUploadPartsRequest call.
    --page-size=: The size of each page to get in the AWS service call.
    --part-source=!: The source file for the upload part.
    --sequence-store-id=!: The Sequence Store ID used for the multipart uploads.
    --starting-token=: A token to specify where to start paginating.
    --upload-id=!: The ID for the initiated multipart upload.
completion:
    flag:
        part-source:
            - SOURCE1
            - SOURCE2
